// SPDX-License-Identifier: MIT


pragma solidity ^0.8.0;

import "./Token.sol";
import "./SafeMath.sol";

contract Exchange is upOnly_v2 {
    using SafeMath for uint;

    address public feeAccount; //account that receives exchange fees
    uint256 public feePct;
    mapping(address => mapping(address => uint256)) public tokens;


    constructor(address _feeAccount, uint256 _feePct) {
        feePct = _feePct;
        feeAccount = _feeAccount;
    }

    function depositToken(address _token, uint256 _amount) public {
        require(upOnly_v2(_token).transferFrom(msg.sender, address(this), _amount));
        // token.approve(address(this), _amount);
        tokens[_token][msg.sender] = tokens[_token][msg.sender].add(_amount);
        

    }
}











/*
Deposit and withdraw funds
manage orders - make and cancel
handle trades - charge fees

to do:
[] deposit ether
[] withdraw ether
[] deposit tokens
[] withdraw tokens
[] check balance
[] make order
[] cancel order 
[] fill order
[] charge fees
*/
